        var expireString = y + '-' + pad('00',m,true) + '-' + pad('00',d,true) + 'T23:59:59Z';
        var expireDate = new Date(expireString);
        document.cookie = "adventcal=hide; expires="+expireDate.toGMTString()+"; path=/";
