var ajaxPromise = function (url, method = 'GET', data) {
    let xhr = new XMLHttpRequest();

    const promise = new Promise(function (resolve, reject) {

        xhr.open(method, url, true);
        xhr.setRequestHeader('Cache-Control', 'no-cache');
        xhr.setRequestHeader('Content-type', 'plain/text');
        xhr.onload = function () {
            if (this.status >= 200 && this.status < 300) {
                resolve(xhr.response);
            } else {
                reject(xhr.response);
            }
        };
        xhr.onerror = function () {
            reject(xhr.response);
        };
        xhr.send(data);
    });

    promise.cancel = function() {
        xhr.abort();
    };

    promise.url = function() {
        return url;
    };

    return promise;
}

var ajaxPageReload = {
    contentSelector: 'ajaxContent',
    searchFormSelector: 'xajax_form_kesearch_pi1',
    rawType: '9003',
    reloadSelector: 'pageContentReload',
    mainNavigationSelector: 'mainNaviRow',
    mainNavigationActiveSelector: 'active',
    disabledSelectors: ['.banner', '.lightbox', '.fancybox', '.external-link', '.no-action', '.sm2-bar-ui'],
    currentAjaxPromise: null,
	debug: true,

    init: function() {
        this.bindEvents();
    },

    bindEvents: function() {
        var ctrl = this;
        document.body.addEventListener('click', ctrl.handleLinkClick);
        document.body.addEventListener('submit', ctrl.handleFormSubmit);

		window.addEventListener('popstate', function(event) {
			var stateLocation = event.currentTarget.location;
			if (stateLocation.origin == window.location.origin) {
				ctrl.handleAjaxLink(stateLocation.pathname);
			}
		});
    },

    isAllowed: function(link) {
        var ctrl = this;
        // check if link is in element that is not allowed to execute ajax page reload
        for (let i = 0; i < ctrl.disabledSelectors.length; i++) {
            var element = link.closest(ctrl.disabledSelectors[i]);
            if (element)
                return false;
        }

        // check if href is set
        var href = link.getAttribute('href');
        if (!href)
            return false;

        // check if href is local call
        if (!href.startsWith('/'))
            return false;

        // check if href is local call with absolute url
        if (href.startsWith('http') && !href.includes(window.location.hostname))
            return false;

        return true;
    },

    handleLinkClick: function(event) {
        var ctrl = ajaxPageReload;
        var link = event.target.closest('a');

        if (link && ctrl.isAllowed(link)) {
            event.preventDefault();
            ctrl.handleAjaxLink(link.getAttribute('href'));
        }
    },

    handleFormSubmit: function(event) {
        var ctrl = ajaxPageReload;
        var form = event.target;
        let url = null;

        switch (form.getAttribute('id')) {
            case ctrl.searchFormSelector:
                url = form.action;

                if (url && (url.startsWith('/') || url.includes(window.location.hostname))) {

                    if (form.method == 'get') {
                        var params = new URLSearchParams();
                        for (var element of form.elements) {
                            if (element.name) {
                                params.append(element.name, element.value);
                            }
                        }
                        url = url + '?' + params.toString() + '&type=' + ctrl.rawType;
                    }

                    event.preventDefault();
                    ctrl.handleAjaxLink(url);

                    // close searchbox if it is open
                    var searchbox = $('#searchBoxRow .innerWrap');
                    if (searchbox.is(':visible'))
                        document.querySelectorAll('.searchboxOpener')[0].click();

                }

                break;
            default:
                // unknown form no handling
                break;
        }

    },

    handleAjaxLink: function(url, data) {
        var ctrl = this;

        urlPlainContent = url.replace(".html", ".raw");

        var ajaxContent = document.getElementById(ctrl.contentSelector);
        document.body.setAttribute('data-loader', 'true');

        ctrl.resetNavigationStatus();
        ctrl.scrollToContent()

        if (ctrl.currentAjaxPromise !== null) {

            // do not start a request to same url
            if (ctrl.currentAjaxPromise.url() == urlPlainContent)
                return;

            ctrl.currentAjaxPromise.cancel();
            ctrl.currentAjaxPromise = null;
        }

        ctrl.currentAjaxPromise = new ajaxPromise(urlPlainContent, data)

        ctrl.currentAjaxPromise.then(function(response) {

            ctrl.replaceContent(response);
            document.body.setAttribute('data-loader', 'false');

            // URL im Browser aktualisieren
            // remove type from url to prevent user reload in browser to get as plain
            var searchParams = new URLSearchParams(url);
            searchParams.delete('type');

            url = decodeURIComponent(searchParams.toString());
            if (url.substring(url.length - 1, url.length) == '=')
                url = url.substring(0, url.length - 1);

            //url = `${url.split('?')[0]}?${searchParams.toString()}`;
            history.pushState(null, "", url);


            ctrl.setNavigationStatusByUrl();

			var consentManager = klaro.getManager();
			if (consentManager && consentManager.consents.statistics) {
				var titleParts = document.title.split(" | ");
				var pageTitle = titleParts[0];
				var pageLocation = url;
				var params = {
					page_title: pageTitle,
					page_location: pageLocation
				};
				gtag('event', 'page_view', params);
			}

            ctrl.currentAjaxPromise = null;

        }).catch(function(error) {

            ctrl.currentAjaxPromise = null;

        });
    },

    // remove classes from navigation which represent the active state
    resetNavigationStatus: function() {
        var ctrl = this;
        var links  = document.querySelectorAll('#' + ctrl.mainNavigationSelector + ' a');

        for (let i = 0; i < links.length; i++) {
            links[i].classList.remove(ctrl.mainNavigationActiveSelector);
        }
    },

    // set classes for navigation which represent the active state
    setNavigationStatusByUrl: function() {
        var ctrl = this;
        var links  = document.querySelectorAll('#' + ctrl.mainNavigationSelector + ' a');

        for (let i = 0; i < links.length; i++) {
            if (links[i].href == window.location.href) {
                links[i].classList.add(ctrl.mainNavigationActiveSelector);
            }
        }
    },

    // scroll to top of the page
    scrollToContent: function() {
        var ctrl = this;
        var container = document.getElementsByTagName('body');

        container[0].scrollIntoView({ behavior: 'smooth' });
    },

    // handleBrowserHistoryButtons: function(event) {
    //     var ctrl = this;
    // },

    // replace content and execute javascript
    replaceContent: function(content) {
        var ctrl = this;
        var container = document.getElementById(ctrl.contentSelector);

		var div = document.createElement('div');
		div.innerHTML = content;
		ctrl.handleMetaTags(div);
        container.innerHTML = div.innerHTML;

        // init external global javascript
        initPowermailFieldwrapSelect();
		specials.init();

        var scriptElements = container.getElementsByTagName('script');
        for (var i = 0; i < scriptElements.length; i++) {
            var scriptElement = scriptElements[i];
            var scriptCode = scriptElement.textContent;
            eval(scriptCode);
        }

    },

	handleMetaTags: function(container) {
		var ctrl = this;
		var metaDiv = container.querySelector('#meta-tags');
		if (metaDiv) {
			var title = metaDiv.querySelector('#title');
			if (title)
				document.title = title.innerText;
		}
		metaDiv.remove();
	},

	logState: function($msg, $object) {
		if (this.debug) {
			console.debug({
				message: $msg,
				details: $object
			});
		}
	}

}
ajaxPageReload.init();

function upload(element,index = 0) {
    if (!element.files[index]) {
        return;
    }

    var newProgressBar = document.createElement('DIV');
    newProgressBar.className = 'progressBar';
    var newProgress = document.createElement('DIV');
    newProgress.className = 'progress';
    newProgress.innerHTML = '<span class="fileName">' + element.files[index]['name'] + '</span><span class="percent"></span>'
    newProgressBar.appendChild(newProgress);
    element.parentNode.querySelector('.progressArea').appendChild(newProgressBar);

    var data = new FormData();
    data.append('SelectedFile', element.files[index]);

    var request = new XMLHttpRequest();
    request.onreadystatechange = function(){
        if(request.readyState == 4){

            try {
                var resp = JSON.parse(request.response);
                // element.parentNode.querySelector('.progressArea').removeChild(newProgressBar);
            } catch (e){
                var resp = JSON.parse(request.responseText);
                var error = {
                    status: 'error',
                    resp: request.responseText
                };
                console.log(error);
            }
            var uploadedFile = resp.fileName;
            var hiddenInput = document.getElementById(element.getAttribute('data-target'));
            if (hiddenInput.value == '') {
                hiddenInput.value = uploadedFile;
            } else {
                hiddenInput.value += ', ' + uploadedFile;
            }

            element.parentNode.classList.add('ajaxFileUploaded');

            if (element.parentNode.querySelector('.previewImage')) {
                var previewImages = element.parentNode.querySelectorAll('.previewImage .image');
                if (previewImages[0].style.backgroundImage === '') {
                    previewImages[0].style.backgroundImage = 'url(/' + uploadedFile + ')';
                } else {
                    var previewImage = document.createElement('DIV');
                    previewImage.className = 'image';
                    previewImage.style.backgroundImage = 'url(/' + uploadedFile + ')';
                    element.parentNode.querySelector('.previewImage').appendChild(previewImage);
                }

                var hint = element.parentNode.querySelector('.previewImage .hint');
                hint.style.opacity = 0;

                newProgressBar.style.opacity = 0;
                newProgressBar.style.visibility = 'hidden';
                element.parentNode.querySelector('.progressArea').removeChild(newProgressBar);
            } else {
                newProgressBar.setAttribute('data-uploaded','true');
                newProgress.querySelector('.percent').innerHTML = '100';
            }

            newIndex = index + 1;
            upload(element,newIndex);
        }
    };
    request.upload.addEventListener('progress', function(e){
        percent = parseInt(e.loaded/e.total * 100);
        newProgress.querySelector('.percent').innerHTML = percent;
        newProgress.style.width = percent + '%';
    }, false);

    request.open('POST', '?eID=ajaxupload');
    request.send(data);
}

document.body.addEventListener('change', handleAjaxFileUpload);
function handleAjaxFileUpload(event) {
    if (event.target.classList.contains('ajaxFileUpload')) {
        if(event.target.files.length === 0){
            return;
        } else {
            upload(event.target);
        }
    }
}

document.body.addEventListener('click', handleUploadButtons);
function handleUploadButtons(event) {
    if (event.target.classList.contains('ajaxUploadButton')) {
        event.preventDefault();
        let inputField = event.target.parentNode.querySelector('.ajaxFileUpload');
        inputField.click();
    }
    if (event.target.classList.contains('ajaxUploadDeleteButton')) {
        event.preventDefault();
        event.target.parentNode.classList.remove('ajaxFileUploaded');
        event.target.parentNode.querySelector('.progressArea').innerHTML = '';

        const ajaxFileUpload = event.target.parentNode.querySelector('.ajaxFileUpload');
        if (ajaxFileUpload) {
            const hiddenInput = document.getElementById(ajaxFileUpload.dataset.target);
            if (hiddenInput) {
                hiddenInput.value = '';
            }
        }
    }
}
